import * as React from 'react';
import { useTheme } from '@mui/material/styles';
import { AreaChart, Line, XAxis, YAxis, Label, ResponsiveContainer } from 'recharts';
import Title from './Title';

function createData(date, max, min, average) {
    return { date, max, min, average };
  }
  
  const tem = [
    createData("2022-01-01", 7.54, 4.43, 6.22)
  ];
  
  export default function Chart() {
    const theme = useTheme();
    
        <div>
          {tem.map(user =>{
            return (<div key={user.id}>
              {user.name}
              </div>)
          })}
        </div>
      
    
  
    return (
      <React.Fragment>
        <Title>Today</Title>
        <ResponsiveContainer>
          <AreaChart
            data={tem}
            margin={{
              top: 16,
              right: 16,
              bottom: 0,
              left: 24,
            }}
          >
            <XAxis
              dataKey="time"
              stroke={theme.palette.text.secondary}
              style={theme.typography.body2}
            />
            <YAxis
              stroke={theme.palette.text.secondary}
              style={theme.typography.body2}
            >
              <Label
                angle={270}
                position="left"
                style={{
                  textAnchor: 'middle',
                  fill: theme.palette.text.primary,
                  ...theme.typography.body1,
                }}
              >
                Temperature

              </Label>
            </YAxis>
            <Line
              isAnimationActive={false}
              type="monotone"
              dataKey="amount"
              stroke={theme.palette.primary.main}
              dot={false}
            />
          </AreaChart>
        </ResponsiveContainer>
      </React.Fragment>
    );
  }
